import { Flex, Box } from 'reflexbox'
import { Label, Input } from '@rebass/forms'
import styled from '@emotion/styled'


function auth(){
    state = {
        email: '',
        password: ''
    }
    const { email, password } = this.state
    return(
        <Box variant = "formContainer" as = "form" onSubmit = {e => e.preventDefault()}>
            <Label htmlFor='email'>Email</Label>
                <Input
                    id='email'
                    name='email'
                    type='email'
                    value = {email}
                /><br />
                <Label htmlFor='password'>Password</Label>
                <Input
                    id='password'
                    name='password'
                    type='password'
                    value = {email}
                />
                <ButtonStyled variant = "submitButton">Login</ButtonStyled>
        </Box>
    )
}

const ButtonStyled = styled.button`
    border: 1px solid black;
    height: 30px;
    width: 70px;
    font-weight: bold;
    margin-top: 20px;
`
export default auth
